  var nomeFilmeFavorito = campoNomeFilme.value
  var filmeFavorito = campoFilme.value
  var elementoFilme = "<img src="+filmeFavorito+">"
  filmes.push(nomeFilmeFavorito)
  imgfilmes.push(filmeFavorito)
